import titleandimage from 'react';
import './BioSection.css'; // (this is where the css will go)

const BioSection = ({ title, description, image }) => {
  return (
    <div className="bio-container">
      <div className="bio-paper">
        <h1>{title}</h1>
        <p>{description}</p>
      </div>
      <div className="bio-paper-img">
        <img src={image} alt="bio-section" />
      </div>
    </div>
  );
};

export default BioSection;
